      \   <p>\\n      <span>\\n        09\\n        octobre\\n        2024\\n      </span>\\n
      \   </p>\\n\\n    <h1><span class=\\\"field field--name-title field--type-string
      field--label-hidden\\\">Direction Interminist\xE9rielle du Num\xE9rique (DINUM)</span>\\n</h1>\",\"<div>\\n
      \     <p class=\\\"fr-text--xl\\\">\\n                    La direction interminist\xE9rielle
      du num\xE9rique (DINUM) est en charge de la transformation num\xE9rique de l\u2019\xC9tat
      au b\xE9n\xE9fice du citoyen comme de l\u2019agent, sous tous ses aspects :
      modernisation du syst\xE8me d\u2019information de l\u2019\xC9tat, qualit\xE9
      des services publics num\xE9riques, cr\xE9ation de services innovants pour les
      citoyens \u2026\\n          </p>\\n      \\n                      <img loading=\\\"lazy\\\"
      src=\\\"/files/page/2020/desktop_Ministre_Direction_03.jpg\\\" width=\\\"1584\\\"
      height=\\\"396\\\" alt=\\\"DINUM, avec le num\xE9rique, nous cr\xE9ons le service
      public de demain\\\" />\",\"<div class=\\\"paragraph paragraph--type--ds-contenu-libre
      paragraph--view-mode--default fr-grid-row fr-grid-row--center\\\">\\n        <div
      class=\\\"fr-col-12\\\">\\n            <div class=\\\"fr-prose\\\">\\n    <h2>Les
      missions</h2>\\n<p>La direction interminist\xE9rielle du num\xE9rique (DINUM),
      cr\xE9\xE9e par <a href=\\\"https://www.legifrance.gouv.fr/affichTexte.do?cidTexte=JORFTEXT000039281619\\\"
      title=\\\"le d\xE9cret du 25 octobre 2019 - lien externe, nouvelle fen\xEAtre\\\"
      target=\\\"_blank\\\" rel=\\\"noopener noreferrer external\\\">le d\xE9cret
      du 25 octobre 2019</a>, prend la suite de la direction interminist\xE9rielle
      du num\xE9rique et du syst\xE8me d\u2019information et de communication de l\u2019\xC9tat
      (DINSIC).</p>\\n<p>Elle accompagne les minist\xE8res dans leur transformation
      num\xE9rique, conseille le Gouvernement et d\xE9veloppe des services et ressources
      partag\xE9es comme le r\xE9seau interminist\xE9riel de l\u2019\xC9tat, <a href=\\\"https://franceconnect.gouv.fr/\\\"
      title=\\\"FranceConnect - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">FranceConnect</a>, <a href=\\\"https://www.data.gouv.fr/\\\"
      title=\\\"data.gouv.fr - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">data.gouv.fr</a> ou <a href=\\\"https://api.gouv.fr/\\\"
      title=\\\"api.gouv.fr - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">api.gouv.fr</a>.</p>\\n<p>Elle pilote,
      avec l\u2019appui des minist\xE8res, <a href=\\\"https://numerique.gouv.fr/publications/tech-gouv-strategie-et-feuille-de-route-2019-2021/\\\"
      title=\\\"le programme TECH.GOUV d\u2019acc\xE9l\xE9ration de la transformation
      num\xE9rique du service public - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">le programme TECH.GOUV d\u2019acc\xE9l\xE9ration
      de la transformation num\xE9rique du service public</a>.</p>\\n<p>La DINUM est
      un service du Premier ministre, plac\xE9 sous l\u2019autorit\xE9 de la ministre
      de la Transformation et de la Fonction publiques.</p>\\n<h2>Organisation</h2>\",\"<p>La
      DINUM comprend une direction de programme, trois d\xE9partements et un secr\xE9tariat
      g\xE9n\xE9ral :</p>\\n<ul>\\n<li>la direction de programme TECH.GOUV pilote
      le programme interminist\xE9riel de transformation num\xE9rique du service public
      TECH.GOUV\u2009;</li>\\n<li>le d\xE9partement \xAB Infrastructures et services
      op\xE9r\xE9s&nbsp;\xBB (ISO) con\xE7oit et op\xE8re des services d\u2019infrastructures
      \xE0 valeur ajout\xE9e mutualis\xE9s entre les administrations, dont le r\xE9seau
      interminist\xE9riel de l\u2019Etat (RIE)\u2009;</li>\\n<li>le d\xE9partement
      <a href=\\\"https://www.etalab.gouv.fr/\\\" title=\\\"Etalab - lien externe
      - nouvelle fen\xEAtre\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer
      external\\\">Etalab</a> coordonne la conception et la mise en \u0153uvre de
      la strat\xE9gie de l\u2019\xC9tat dans le domaine de la donn\xE9e, dont ses
      composantes juridique et soci\xE9tale\u2009;</li>\\n<li>le d\xE9partement \xABPerformance
      des services num\xE9riques\xBB (PSN) con\xE7oit les plans d\u2019actions interminist\xE9riels
      en mati\xE8re de mutualisation, d\xE9mat\xE9rialisation, pilotage des projets
      et qualit\xE9 des services num\xE9riques, et soutient leur mise en \u0153uvre\u2009;</li>\\n<li>le
      secr\xE9tariat g\xE9n\xE9ral soutient l\u2019activit\xE9 de la direction : il
      assure la communication externe et interne, la gestion des ressources humaines
      et financi\xE8res, la synth\xE8se des missions et veille \xE0 la qualit\xE9
      des conditions de travail des agents.</li>\\n</ul>\\n<p>Pour en savoir plus
      :</p>\",\"</div>\\n\\n        </div>\\n      </div>\\n      \\n                <ul
      class=\\\"paragraph paragraph--type--ds-boutons paragraph--view-mode--default
      fr-btns-group fr-btns-group--inline-sm fr-btns-group--md fr-btns-group--left
