      class=\\\"fr-col-12\\\">\\n            <div class=\\\"fr-prose\\\">\\n    <h2>Les
      missions</h2>\\n<p>La direction interminist\xE9rielle du num\xE9rique (DINUM),
      cr\xE9\xE9e par <a href=\\\"https://www.legifrance.gouv.fr/affichTexte.do?cidTexte=JORFTEXT000039281619\\\"
