      title=\\\"data.gouv.fr - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">data.gouv.fr</a> ou <a href=\\\"https://api.gouv.fr/\\\"
      title=\\\"api.gouv.fr - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">api.gouv.fr</a>.</p>\\n<p>Elle pilote,
      avec l\u2019appui des minist\xE8res, <a href=\\\"https://numerique.gouv.fr/publications/tech-gouv-strategie-et-feuille-de-route-2019-2021/\\\"
      title=\\\"le programme TECH.GOUV d\u2019acc\xE9l\xE9ration de la transformation
      num\xE9rique du service public - lien externe, nouvelle fen\xEAtre\\\" target=\\\"_blank\\\"
      rel=\\\"noopener noreferrer external\\\">le programme TECH.GOUV d\u2019acc\xE9l\xE9ration
      de la transformation num\xE9rique du service public</a>.</p>\\n<p>La DINUM est
      un service du Premier ministre, plac\xE9 sous l\u2019autorit\xE9 de la ministre
      de la Transformation et de la Fonction publiques.</p>\\n<h2>Organisation</h2>\"}],\"model\":\"albert-small\",\"frequency_penalty\":0.0,\"logit_bias\":null,\"logprobs\":false,\"top_logprobs\":null,\"presence_penalty\":0.0,\"max_tokens\":100,\"max_completion_tokens\":null,\"n\":1,\"response_format\":null,\"seed\":null,\"stop\":[],\"stream\":false,\"stream_options\":null,\"temperature\":0.7,\"top_p\":1,\"tools\":null,\"tool_choice\":\"none\"}"
